import React from 'react';

export const ItemGrid = props => {
    const showProduct = props.boxs.map(box => { 
        return <Product
            key={props.image}
            name={box.name}
            price={box.price}
            image={box.image}
        />
    });

    return (
        <div className='container grid-three-column'>
            {props.showProduct}
        </div>
    );
}
